import React from 'react'

function Home() {
  return (
    <div className="homebg">
      <div className='flex justify-center flex-col h-[100vh] pl-[2rem] gap-[1rem]'>
      <p className='font-medium text-2xl'>New Inspiration 2024</p>
      <h1 className='text-[#ff5252] font-semibold text-5xl'>NEW COLLECTION!</h1>
      <p className='font-medium text-1xl'>Trending from men's and women's style collection</p>
      </div>
    </div>
  )
}

export default Home;
